column5:
Allow the disabling of automatic response decoding.

The following will disable their respective decoders:

  $curl->setDefaultDecoder(false);
  $curl->setJsonDecoder(false);
  $curl->setXmlDecoder(false);

fix: HTTP 301 导致$response内有header
$response_header = 'HTTP 301...';
$response = 'HTTP 200.....<body>';

Fix "Notice: Array to string conversion"

Fix "Notice: Array to string conversion" when $value in curl_setopt($ch, CURLOPT_POSTFIELDS, $value) is an array that contains an empty array. Example that causes Notice:

$data = array(
    'foo' => 'bar',
    'baz' => array(
    ),
);
